import Counter from "./components/Counter";
// import Input from "./components/Input";

class App extends Component {
  state = { data: [], name: "", imgUrl: "" ,update:""};

  
  render() {
    return (
      <div>
      <Counter />
      </div>
    );
  }
}

export default App;
